    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1956. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and vegetation control.
    Resource management is outlined; topics include grazing and fur harvesting. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, and
    Refuge participation. Items of interest and N-R forms are attached. A short narrative
    report of North Platte National Wildlife Refuge is included.",nt"license_title":
